<strong>gdb-json-partial-output</strong> is a compiled Lisp function in `<code>gdb-mi.el</code>'.</br>
</br>
(gdb-json-partial-output &optional <u>FIX-KEY</u> <u>FIX-LIST</u>)</br>
</br>
Prepare and parse gdb-partial-output-buffer with `json-read'.</br>
</br>
<u>FIX-KEY</u> and <u>FIX-KEY</u> work as in `gdb-jsonify-buffer'.
